body.script:
	var originalCampaignValue = null;
		function addParam() {
		var campaignValue = getUrlParam('CampaignValue') || getUrlParam('campaignvalue');
		if (!originalCampaignValue && campaignValue) {
			originalCampaignValue = campaignValue;
		}
		var valueToUse = originalCampaignValue || campaignValue;
		console.log('Using campaign value:', valueToUse);
		if (valueToUse) {
			var links = document.querySelectorAll('a');
			links.forEach(function(link) {
				if (link.href && link.href.startsWith('http') && !link.href.includes('#')) {
					if (link.href.includes('campaignvalue=') || link.href.includes('CampaignValue=')) {
						link.href = link.href.replace(/[?&](campaignvalue|CampaignValue)=[^&]*/, '');
					}
					var separator = link.href.includes('?') ? '&' : '?';
					link.href += separator + 'campaignvalue=' + encodeURIComponent(valueToUse);
				}
			});
		}
	}

	function getUrlParam(name) {
		// Check query parameters
		var match = new RegExp('[?&]' + name + '=([^&]*)').exec(window.location.search);
		if (match) return decodeURIComponent(match[1]);

		// Check URL path
		match = new RegExp('/' + name + '=([^/?#]*)').exec(window.location.pathname);
		return match ? decodeURIComponent(match[1]) : null;
	}
jQuery(document).ready(function() {
	addParam();
	setTimeout(addParam, 1000);
	document.addEventListener('click', function() {
		setTimeout(addParam, 100);
	});
});

